Sampled at Saln Piva;
Aroma: Flowery; Citrusy; Slight malt; Very pleasant;
Appearance: Amber clear;
Taste: Great balance; Body of unbelievable harmony; Superb carbonation; Aroma fluently manifests on the tongue;
Palate: Medium body; 
Overall: Best beer from 11 samples; This is truly a work of an expert;

On tap at Stupavar Beer Pub Bratislava;
Appearance: Small head; Dark amber colour;
Aroma: Lychee; Caramel; Flowers; 
Taste: Hops; Malty;
Aftertaste: Bitter;

On tap at Stupavar Beer Pub Bratislava;
